                    <text id="description" font-family="RobotoMono-Regular, Roboto Mono" font-size="18" font-weight="normal" line-spacing="28" fill="#000000">
                        <tspan x="30" y="101">Artwishlist unifies the art market by facilitating dealers, </tspan>
                        <tspan x="30" y="129">advisors &amp; collectors matchmaking through its Introductions </tspan>
                        <tspan x="30" y="157">Platform. It relies on the Provenance Database which contains </tspan>
                        <tspan x="30" y="185">details for over 10 million artworks which can be researched </tspan>
                        <tspan x="30" y="213">online or through Glass, Artwishlist's chat bot image recognition </tspan>
                        <tspan x="30" y="241">service.</tspan>
                    </text>
